define("timeseries/structure.css", ["curl/plugin/style", "require"], function (injector, require) { var text = "
#timeseries-viz rect {
  /*fill: #3D4F73;*/
  fill: #B3060D;
  shape-rendering: crispEdges;
}

#timeseries-viz .y.axis line, #timeseries-viz .y.axis path {
  fill: none;
  stroke: #555;
}

#timeseries-viz .x.axis line {
  fill: none;
  stroke: none;
}

#timeseries-viz text {
  fill: #555;
  font-size: 0.9em;
}



"; if (0) text = injector.translateUrls(text, require.toUrl("")); return text; });
define("curl/plugin/css!timeseries/structure.css", ["curl/plugin/style!timeseries/structure.css"], function (sheet) { return sheet; });
